pragma solidity ^0.8.0;

contract RefinedContract {
    address public owner;
    address public token;
    address public staking;

    function launch() public {
        // Ensure the caller is the owner
        require(msg.sender == owner, "Ownable: caller is not the owner");

        // Open trading on the token contract
        require(token.code.length > 0, "Token contract does not exist");
        (bool tradingSuccess, ) = token.call(abi.encodeWithSignature("openTrading(uint256)", 0));
        require(tradingSuccess, "Failed to open trading");

        // Check the token balance of this contract
        require(token.code.length > 0, "Token contract does not exist");
        (bool balanceSuccess, bytes memory balanceData) = token.staticcall(abi.encodeWithSignature("balanceOf(address)", address(this)));
        require(balanceSuccess, "Failed to get balance");
        uint256 contractBalance = abi.decode(balanceData, (uint256));

        // Transfer tokens to the staking contract
        require(token.code.length > 0, "Token contract does not exist");
        (bool transferToStakingSuccess, ) = token.call(abi.encodeWithSignature("transfer(address,uint256)", staking, contractBalance));
        require(transferToStakingSuccess, "Failed to transfer to staking");

        // Transfer ownership of the token contract back to the owner
        require(token.code.length > 0, "Token contract does not exist");
        (bool transferOwnershipSuccess, ) = token.call(abi.encodeWithSignature("transferOwnership(address)", owner));
        require(transferOwnershipSuccess, "Failed to transfer ownership");
    }
}
